namespace Tests\Unit\Util;

use App\Http\Util\IDReserver;
use Tests\TestCase;

class IDReserverTest extends TestCase
{

    public function testID()
    {
        $idResever = new IDReserver();
        $this->assertEquals("byron", $idResever->getUserID());
    }

    public function testSetID()
    {
        $idResever = new IDReserver();
        $idResever->setUserID("12346465");

        $this->assertEquals("12346465", $idResever->getUserID());
    }

    public function testSave()
    {
        $img = 'data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/2wBDAAUDBAQEAwUEBAQFBQUGBww
        IBwcHBw8LCwkMEQ8SEhEPERETFhwXExQaFRERGCEYGh0dHx8fExciJCIeJBweHx7/2wBDAQUFBQcGBw4ICA4eFBEUHh4eHh4e
        Hh4eHh4eHh4eHh4eHh4eHh4eHh4eHh4eHh4eHh4eHh4eHh4eHh4eHh4eHh7/wAARCAPAAhwDASIAAhEBAxEB/8QAHQAAAQQDAQEA
        AAAAAAAAAAAAAAQFBgcBAgMICf/EAFEQAAEDAwMCBAQDBQUEBwYDCQECAxEABAUGITESQQcTUWEIcYGRFCKhFSMyscE3QnWz0RYkM1IXNDVD
        ';
        $userID = 'byron';
        $this->saveHead($img, $userID);
    }


    private function saveHead($img, $userID)
    {
        $img_array = explode(',', $img);
        $base_img = '';
        if (count($img_array) != 2) {
            for ($i = 1; $i < count($img_array); $i++) {
                $base_img = $base_img . $img_array[$i];
            }
        } else {
            $base_img = $img_array[1];
        }
        $name = 'head_' . $userID . '.png';
        $path = public_path('images/default.jpg');
        $path = str_replace('default.jpg', $name, $path);
        $file = fopen($path, 'wb');
        fwrite($file, base64_decode($base_img));
        fclose($file);
    }

}
